An SOF source file is a program or part of a program in the SOF programming language. The source files shall end with .sof or .stackof; the latter mainly for extension collisions. Every SOF source file must adhere to the following Extended Backus-Naur form specification: (* A program is a series of tokens and comments, where tokens MUST be separated by whitespace. *)
SofProgram = [Token] { [Comments] ?Whitespace? [Comments] Token } { [Comments] ?Whitespace? } ; Token = "def" | "globaldef" | "dexport" | "use" | "export" | "dup" | "pop" | "swap" | "write" | "writeln" | "input" | "inputln" | "if" | "ifelse" | "while" | "dowhile" | "switch" | "function" | "constructor" | "+" | "-" | "*" | "/" | "%" | "<<" | ">>" | "cat" | "and" | "or" | "xor" | "not" | "<" | "<=" | ">" | ">=" | "=" | "/=" | "." | ":" | "," | ";" | "nativecall" | "[" | "]" | "|" | "describe" | "describes" | "assert" | Number | String | Boolean | Identifier | CodeBlock ; Identifier = ?Unicode Letter? { ?Unicode Letter? | DecimalDigits | "_" | "'" | ":" } ;
(* A code block recursively contains SOF code, i.e. an SofProgram. *)
CodeBlock = "{" SofProgram "}" ; (* Literals *)
String = '"' { ?any character except "? '\"' } '"' ;
Boolean = "true" | "false" | "True" | "False" ;
Number = [ "+" | "-" ] ( Integer | Decimal ) ;
Integer = "0" ( "h" | "x" ) HexDigits { HexDigits } | [ "0d" ] DecimalDigits { DecimalDigits } | "0o" OctalDigits { DecimalDigits } | "0b" BinaryDigits { BinaryDigits } ;
Decimal = DecimalDigits { DecimalDigits } "." DecimalDigits { DecimalDigits } [ ("e" | "E") ( "+" | "-" ) DecimalDigits { DecimalDigits } ] ;
BinaryDigits = "0" | "1" ;
OctalDigits = BinaryDigits | "2" | "3" | "4" | "5" | "6" | "7" ;
DecimalDigits = OctalDigits | "8" | "9" ;
HexDigits = DecimalDigits | "a" | "b" | "c" | "d" | "e" | "f" | "A" | "B" | "C" | "D" | "E" | "F" ; (* Comments are ignored. *)
Comments = Comment { Comment } ;
Comment = ( "#" { ?any? } ?Unicode line break/newline? ) | ( "#*" { ?any? } "*#" ) ; Here, SofProgram is the syntax specification for an entire SOF source file. The source file consists of two types of syntactical constructs: Comments and Tokens . Comments are purely for the benefit of the programmer and are entirely ignored. Tooling is encouraged to place programming-language-like information about the code inside comments. There are two types of comments: Single-line comments start with # and extend to the end of the line, while multi-line comments start with #* and end with *# and can span multiple lines. In the following and the language reference in general, comments are treated as non-existent, and it is recommended to remove comments from the source code as one of the first steps of code processing. Tokens are the core of the SOF program. The tokens are ordered in a linear sequence. The only exception is the code block token: A code block recursively nests another sequence of tokens. The major other differentiation in the token type is between the Literal Tokens that behave and look like the literals in other programming languages, as well as the Primitive Tokens aka. keywords that execute program logic.
